import { 
    Flex,
    Heading
} from '@chakra-ui/react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHammer } from "@fortawesome/free-solid-svg-icons";
const Logo = () => {
    return (
        <Flex
            gap="0.5rem"
            fontSize="2rem"
        >
            <FontAwesomeIcon 
                icon={faHammer} 
                style={{
                    bgColor: "#ff8177",
                    bgImage: "linear-gradient(to top, #ff0844 0%, #ffb199 100%)",
                    bgSize: "100%",
                    '-webkit-background-clip': 'text',
                    '-webkit-text-fill-color': 'transparent'
                }}
            />
            <Heading as="h1"            bgColor="#ff8177"
            bgImage="linear-gradient(to top, #ff0844 0%, #ffb199 100%)"
            bgSize="100%"
            css={{
                '-webkit-background-clip': 'text',
                '-webkit-text-fill-color': 'transparent'
            }}>
                            <FontAwesomeIcon 
                icon={faHammer} 
                style={{
                    bgColor: "#ff8177",
                    bgImage: "linear-gradient(to top, #ff0844 0%, #ffb199 100%)",
                    bgSize: "100%",
                    '-webkit-background-clip': 'text',
                    '-webkit-text-fill-color': 'transparent'
                }}
            />
                BreakDown
            </Heading>
        </Flex>
    );
}

export default Logo;
